import React from "react";
import { HStack, Box } from "@chakra-ui/react";

import Sidebar from "./Sidebar";

function Dashboard({}) {
  return (
    <>
      <HStack>
        <Sidebar />
        <Box bg="tomato" h="110vh" flexGrow="1"></Box>
      </HStack>
    </>
  );
}

export default Dashboard;
